import React, { Component } from "react";
import { Link } from "react-router-dom";

// By extending the React.Component class, Counter inherits functionality from it
function ImgContainer(props) {

    const numbers = ['https://i.gifer.com/WyD2.gif', 'https://i.pinimg.com/originals/58/46/2c/58462c6f915dbac62df69a262a8950a2.gif', 'https://i.gifer.com/WyD2.gif', 'https://i.pinimg.com/originals/58/46/2c/58462c6f915dbac62df69a262a8950a2.gif',];
    const listItems = numbers.map((number) =>

        <div className="col-md-3 mt-3" onClick={props.thisIsAnEvent} value="hello world"
            name="search">
            <img className="clickImg" src={number} />
        </div>
    );

    return (
        <div>
            <div className="container">

                <div className="row">
                    {listItems}
                </div>

            </div>
        </div>
    );

}

export default ImgContainer;
